description:
When acclaimed documentary filmmaker D.A. Pennbaker filmed Bob Dylan during a three week concert tour of England in the spring of 1965, he had no idea he was about to create one of the most intimate glimpses of the rock ledgend ever put on film. Wanting to make more than just a concert film, Pennebaker decided to seek both the public and private Bob Dylan. With unobtrusive equipment and rare acess to the elusive performer, he achived a fly-on-wall glimpse of one of the most influential musicians of all time - and redefined filmmaking along the way.
